import React, {Component} from "react";

interface AnyProps {
    name: String
    favoriteNumber: Number
    company: String
}

interface SomeProps {
    name: String
    favoriteNumber: Number
}

class SomeComponent extends Component<AnyProps> {
    constructor(props:AnyProps) {
        super(props);
        this.state = {
            name: 'hi',
            favoriteNumber:0,
            company:'world'
        }
    }
    render() {
        const {name, favoriteNumber} = this.props
        return <span>{this.state}안녕.. {name} {favoriteNumber}</span>
    }
}
export default SomeComponent
